import React, { useState } from 'react';
import { PlusCircle, Zap } from "lucide-react"; 
import SymptomCard from "../shared/SymptomCard"; 
import AddSymptomForm from "../shared/AddSymptomForm";
import { useTheme } from '../ThemeContext';

const SymptomsScreen = ({ colors }) => {
    const { isDarkMode } = useTheme();

    // View state (main, add)
    const [view, setView] = useState('main');

    // Mock symptoms data - in a real app, this would come from API/database
    const [symptoms, setSymptoms] = useState([
      {
        id: 1,
        symptom: "Headache",
        severity: "Moderate",
        time: "2:30 PM",
        date: "Today",
        duration: "3 hours",
        notes: "Frontal region, throbbing",
        triggers: ["Screen time", "Stress"],
        associatedSymptoms: ["Fatigue", "Light sensitivity"],
        timeOfDay: "Afternoon"
      },
      {
        id: 2,
        symptom: "Fatigue",
        severity: "Mild",
        time: "7:00 PM",
        date: "Yesterday",
        duration: "All day",
        notes: "After walking up stairs",
        triggers: ["Exercise", "Poor sleep"],
        associatedSymptoms: [],
        timeOfDay: "Evening"
      },
      {
        id: 3,
        symptom: "Dizziness",
        severity: "Mild",
        time: "10:15 AM",
        date: "Mar 20",
        duration: "30 minutes",
        notes: "When standing up quickly",
        triggers: ["Dehydration"],
        associatedSymptoms: ["Light-headedness"],
        timeOfDay: "Morning"
      }
    ]);

    // Dark mode specific styles
    const cardBg = isDarkMode ? colors.cardBg : 'white';
    const borderColor = isDarkMode ? `${colors.primary}30` : 'rgba(219, 234, 254, 1)';
    const gradientOverlayBg = isDarkMode 
      ? `radial-gradient(circle, ${colors.gradientAlt1}20, transparent 70%)`
      : `radial-gradient(circle, ${colors.primaryLight}30, transparent 70%)`;

    const insightBg = isDarkMode 
      ? colors.cardBg 
      : 'white';

    // Add a new symptom
    const addSymptom = (newSymptom) => {
      const updatedSymptoms = [
        {
          id: symptoms.length + 1,
          ...newSymptom,
          date: "Today" // Simplified for demonstration
        },
        ...symptoms
      ];

      setSymptoms(updatedSymptoms);
      setView('main');
    };

    // Format the display text for symptom date and time
    const formatTimeDisplay = (symptom) => {
      return `${symptom.date}, ${symptom.time}`;
    };

    // Render the appropriate view based on state
    if (view === 'add') {
      return <AddSymptomForm setView={setView} addSymptom={addSymptom} colors={colors} />;
    }

    return (
      <div className="p-6 pb-8">
        <header className="flex justify-between items-center mb-8">
          <div>
            <h1 className="text-3xl font-bold bg-gradient-to-r from-blue-700 to-cyan-500 bg-clip-text text-transparent">Symptoms</h1>
            <p className="text-sm dark-mode-transition" style={{ color: colors.textSecondary }}>Track your health patterns</p>
          </div>
          <button 
            className="w-12 h-12 rounded-full flex items-center justify-center shadow-lg transition-transform hover:scale-110 duration-300" 
            style={{ 
              background: `linear-gradient(135deg, ${colors.primary}, ${colors.accent})`,
              boxShadow: `0 0 15px ${colors.primary}40`
            }}
            onClick={() => setView('add')}
          >
            <PlusCircle size={24} color="white" className="animate-pulse" />
          </button>
        </header>

        {/* Symptom summary with enhanced gradients and animations */}
        <div className="mb-8 p-5 rounded-2xl relative overflow-hidden transform hover:scale-105 transition-all duration-500 animate-breathe"
             style={{ 
               background: `linear-gradient(135deg, ${colors.gradientAlt1}, ${colors.gradientAlt2})`,
               boxShadow: `0 20px 25px -5px ${colors.gradientAlt1}30`
             }}>
          <div className="absolute top-0 right-0 w-32 h-32 rounded-full animate-float" 
               style={{ 
                 background: gradientOverlayBg,
                 transform: 'translate(30%, -30%)'
               }}></div>
          <div className="absolute bottom-0 left-0 w-24 h-24 rounded-full animate-float" 
               style={{ 
                 background: gradientOverlayBg,
                 transform: 'translate(-30%, 30%)',
                 animationDelay: '1s'
               }}></div>

          <div className="relative">
            <h3 className="text-white font-bold text-xl mb-3">Monthly Summary</h3>
            <p className="text-white text-opacity-90 text-sm mb-5">Your most frequent symptoms this month:</p>

            <div className="bg-white bg-opacity-20 backdrop-blur-sm rounded-xl p-4 mb-4 transition-transform hover:scale-105 duration-300">
              <div className="flex justify-between items-center mb-2">
                <span className="text-white text-sm font-medium">Headaches</span>
                <span className="text-white text-xs bg-white bg-opacity-20 px-2 py-0.5 rounded-full">8 occurrences</span>
              </div>
              <div className="w-full bg-white bg-opacity-30 h-3 rounded-full overflow-hidden">
                <div className="bg-white h-3 rounded-full shimmer" style={{ width: '80%' }}></div>
              </div>
            </div>

            <div className="bg-white bg-opacity-20 backdrop-blur-sm rounded-xl p-4 transition-transform hover:scale-105 duration-300">
              <div className="flex justify-between items-center mb-2">
                <span className="text-white text-sm font-medium">Fatigue</span>
                <span className="text-white text-xs bg-white bg-opacity-20 px-2 py-0.5 rounded-full">5 occurrences</span>
              </div>
              <div className="w-full bg-white bg-opacity-30 h-3 rounded-full overflow-hidden">
                <div className="bg-white h-3 rounded-full shimmer" style={{ width: '50%' }}></div>
              </div>
            </div>
          </div>
        </div>

        {/* Recent symptoms with enhanced card designs */}
        <div className="mb-8">
          <div className="flex justify-between items-center mb-4">
            <h3 className="font-bold text-lg dark-mode-transition" style={{ color: colors.textPrimary }}>Recent Symptoms</h3>
            <button className="text-sm font-medium px-3 py-1 rounded-full transition-all duration-300 hover:shadow-md dark-mode-transition" 
                    style={{ color: colors.primary, backgroundColor: `${colors.primary}10` }}>
              View all
            </button>
          </div>

          <div className="space-y-4">
            {symptoms.map(symptom => (
              <SymptomCard
                key={symptom.id}
                symptom={symptom.symptom}
                severity={symptom.severity}
                time={formatTimeDisplay(symptom)}
                note={symptom.notes}
                colors={colors}
              />
            ))}
          </div>
        </div>

        {/* AI Insights with enhanced gradient and animations */}
        <div>
          <h3 className="font-bold text-lg mb-4 dark-mode-transition" style={{ color: colors.textPrimary }}>AI Insights</h3>
          <div className="p-5 rounded-2xl shadow-lg border transform hover:scale-105 transition-all duration-500 dark-mode-transition"
               style={{ 
                 backgroundColor: insightBg,
                 borderColor: borderColor,
                 boxShadow: `0 15px 25px -5px ${colors.primary}20` 
               }}>
            <div className="flex items-start">
